Lonely Planet Discover Peru is your passport to all the most relevant and up-to-date advice on what to see, what to skip, and what hidden discoveries await you.

Take in the spectacle of Machu Picchu at sunrise, treat your taste buds to Lima's famous ceviche, or try to solve the mystery of the Nazca Lines; all with your trusted travel companion. Discover the best of Peru and begin your journey now!
